
#!/sbin/python
import subprocess
import pystray
from PIL import Image
from io import BytesIO
import base64

# Function to execute when the icon is clicked
def launch_arandr(icon):
    subprocess.run(["arandr"])

def launch_pavu(icon):
    subprocess.run(["pavucontrol"])

def launch_radial(icon):
    subprocess.run(["custom_pmenu"])

icon_data = b'''

'''

icon_image = Image.open(BytesIO(base64.b64decode(icon_data)))

# Create the icon with the function as the action
icon = pystray.Icon("Quick-Settings",icon_image, "Quick")
menu_item = pystray.MenuItem("Sound", launch_pavu)
menu_item2 = pystray.MenuItem("Display", launch_arandr)
menu_item3 = pystray.MenuItem("Radial", launch_radial)
# Create a menu and add the menu items
menu = (menu_item, menu_item2,menu_item3)
icon.menu = pystray.Menu(*menu)
# Run the program
icon.run()
